import React from 'react';
import FormLabel from '@material-ui/core/FormLabel';
import FormControl from '@material-ui/core/FormControl';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import Switch from '@material-ui/core/Switch';

export default function SwitchesGroup({ handleChange, setSwitchState, switchState }) {

  return (
    <FormControl component="fieldset">
      <FormLabel component="legend">Assign responsibility</FormLabel>
      <FormGroup>
        <FormControlLabel
          control={<Switch checked={switchState.partTime} onChange={handleChange('Part-time')} value="Part-time" />}
          label="Part-time"
        />
        <FormControlLabel
          control={<Switch checked={switchState.fullTime} onChange={handleChange('full-time')} value="full-time" />}
          label="full-time"
        />
        <FormControlLabel
          control={
            <Switch checked={switchState.contract} onChange={handleChange('contract')} value="antoine" />
          }
          label="contract"
        />
      </FormGroup>
      <FormHelperText>Be careful</FormHelperText>
    </FormControl>
  );
}
